    public static int nearestExit(char[][] maze, int[] entrance) {
        maze[entrance[0]][entrance[1]] = '-';

        int[][] directions = {{1, 0}, {-1, 0}, {0, 1}, {0, -1}};
        Deque<int[]> queue = new LinkedList<>();
        queue.add(entrance);
        int steps = 0;
        while (!queue.isEmpty()) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                int[] cur = queue.poll();
                if (isExit(maze, cur)) {
                    return steps;
                }
                // maze[cur[0]][cur[1]] = '-';

                for (int[] dir : directions) {
                    int nx = cur[0] + dir[0];
                    int ny = cur[1] + dir[1];
                    if (0 <= nx && nx < maze.length && 0 <= ny && ny < maze[0].length && maze[nx][ny] == '.') {
                        queue.add(new int[]{nx, ny});
                        maze[nx][ny] = '-';
                    }
                }
            }
            steps++;
        }

        return -1;
    }

    public static boolean isExit(char[][] maze, int[] cur) {
        return (cur[0] == 0 || cur[0] == maze.length - 1 || cur[1] == 0 || cur[1] == maze[0].length - 1)
                && maze[cur[0]][cur[1]] != '-';
    }


